import axios from "axios";
import { useEffect, useState } from "react";
function Userdata() {
  let [responceData, setResponceData] = useState("")
  useEffect(() => {
    axios
      .get(
        `https://jsonplaceholder.typicode.com/posts`
      )
      .then((response) => {
        setResponceData = response.data;
        console.log(setResponceData)
      });
  }, [])
  return (
    <>
      <div className="container-fluid">
        {/* <button className="bg-success border-success btn-large mr-5" onClick={posts} >click me</button>s */}
      </div>
    </>
  )

}
export default Userdata;
